window.addEventListener('keydown', (event) => {

    if (event.key === 'ArrowDown') {
        current_tag_11085353858710412096 += 1;
        if (current_tag_11085353858710412096 == tags_11085353858710412096.length) {
            current_tag_11085353858710412096 = 0;
        }
        displayTags_11085353858710412096();
