function displayTips() {
    let tasks = document.getElementsByClassName('task11085353858710412096');
    for (let i = 0; i < tasks.length ; i++) {
      let task = tasks[i];
      let tip_id = task.id;
      let tip = document.getElementById('tip_11085353858710412096_'+tip_id);
      tip.style.display='none';
      tasks[i].tip = tip;
      tasks[i].addEventListener('mouseover', mouseOverEffect);
      tasks[i].addEventListener('mouseout', mouseOutEffect);
    }
}

function displayTags_11085353858710412096() {
    tags_11085353858710412096.forEach(function(tag) {
        document.getElementById('tasks_colors_11085353858710412096_'+tag).style.display = 'none';
    });
    document.getElementById('tasks_colors_11085353858710412096_'+tags_11085353858710412096[current_tag_11085353858710412096]).style.display = 'block';
    document.getElementById('tag_label_11085353858710412096').innerHTML = "<text>"+tags_11085353858710412096[current_tag_11085353858710412096]+"</text>";
}

function mouseOverEffect() {
  this.classList.add("task-highlight");
  this.tip.style.display='block';
}

function mouseOutEffect() {
  this.classList.remove("task-highlight");
  this.tip.style.display='none';
}
